[setup]
title=日本語プログラミング言語「なでしこ」のセットアップ
about=日本語プログラミング言語「なでしこ」のセットアップを始めます。\n\nなでしこは、日本語で簡単にプログラムを作成できるツールです。
link=http://nadesi.com
license_txt=ReadMe.txt
dir=C:\Program Files\nadesiko_lang\
exefile=nakopad.exe

[shortcut]
file=nakopad.exe;日本語プログラミング言語「なでしこ」
desktop.visible=1
desktop.checked=0
quicklaunch.visible=1
quicklaunch.checked=1
extension.visible=1
extension.checked=1
startup.visible=0
startup.checked=0
sendto.visible=1
sendto.checked=1
allusers.visible=1
allusers.checked=0

[message]
FileCopy=ファイルをコピーしています。
copy=コピー
halt=処理が中断されました。\n最初からやり直してください。
end=終了
Uninstall?=アンインストールしてもよろしいですか？

[install]
