DisplayName=日本語プログラミング言語「なでしこ」
DisplayIcon=%INSTALL%nakopad.exe

[group]
1=nakopad.exe;日本語プログラミング言語「なでしこ」\なでしこエディタ
2=doc\index.htm;日本語プログラミング言語「なでしこ」\マニュアル
3=setup.ini;日本語プログラミング言語「なでしこ」\セットアップ

[registry]
1=HKEY_CLASSES_ROOT\.nako;=nakoFile
2=HKEY_CLASSES_ROOT\.nako\PersistentHandler;={5e941d80-bf96-11cd-b579-08002b30bfeb}
3=HKEY_CLASSES_ROOT\nakoFile;=なでしこスクリプト
4=HKEY_CLASSES_ROOT\nakoFile\DefaultIcon;=%INSTALL%tools\nako.ico
5=HKEY_CLASSES_ROOT\nakoFile\shell\edit;=編集(&E)
6=HKEY_CLASSES_ROOT\nakoFile\shell\edit\command;="%INSTALL%nakopad.exe" "%1"
7=HKEY_CLASSES_ROOT\nakoFile\shell\open\command;="%INSTALL%vnako.exe" "%1"

[registry.uninstall]
1=HKEY_CLASSES_ROOT\.nako
2=HKEY_CLASSES_ROOT\nakoFile

[dir.uninstall]
1=%APPDATA%nadesiko_lang
2=%INSTALL%

